        (function (doc, win) {

    <style>
        html,body{
            width: 100%;
            height: auto;
            margin: 0;
            background: #f3f3f1;
            font-size: 0;
        }   
        .warp{
            width: 100%;
            background: white;
        }
        img{
            width: 100%;
        }

        /* 动画s */
        .whiteBg{
            font-size: 0px;
            position: relative;
        }
        .textAb{
            position: absolute;
            top: 0;
            left: 0;
            text-align: center;
            width: 100%;
            color: #2db97a;
            line-height: 1;
            font-weight: bold;
        }
        .gif{
            font-size: 1.2rem;
        }
        .day{
            font-size: 0.38rem;
            font-weight: 500;
            margin-top: 0.25rem;
        }
        .day > svg{
            vertical-align: bottom;
        }
        .textLR{
            padding: 0 3px;
        }
        /* 动画end */

        /* 时间s */
        .timeWarp{
            position: relative;
            font-size: 0;
        }
        .time{
            font-family: arial,sans-serif;
            position: absolute;
            top: 0;
            left: 0;
            text-align: right;
            width: 100%;
            font-size: .42rem;
            font-weight: 400;
            padding-right: 1.1rem;
            box-sizing: border-box;
            color: #6c6c6c;
        }
        /* 时间end */

        /* 删除 */
        .warp{
            z-index: 2;
            position: relative;
        }
        .del{
            position: relative;
            top: -400px;
            z-index: 1;
            object-fit: cover;
            contain: block-size;
            vertical-align: baseline;

        }
    </style>
